import React, { Component } from 'react';
import {DISHES} from './shared/Dishes';
import Menu from './components/Menu';

export default class App extends Component {
  constructor(props) {
    super(props);
    this.state = {
      dishes : DISHES
    };
  }

  render() {
    return (
      <div className="container">
        .<Row>

        </Row>
        <Menu dishes={this.state.dishes}/>
      </div>
    )
  }
}
